import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Section from "./Section";
import PersonCard from "./PersonCard";


const App = () => {
    return (
        <div>
            <Header />
            <PersonCard name="John"
                        img="https://upload.wikimedia.org/wikipedia/commons/8/8a/Albobah.jpg"
                        alt="Photo of John"
                        tel="393 023 203"
                        email="j@johanes.com"
            />
            <PersonCard name="Sylvia"
                        img="https://upload.wikimedia.org/wikipedia/commons/c/c3/ILAvatar.png"
                        alt="Photo of Sylvia"
                        tel="423 989 673"
                        email="s@antons.com"/>
            <PersonCard name="Mike"
                        img="https://upload.wikimedia.org/wikipedia/commons/b/b2/Biju-ui-developer.png"
                        alt="Photo of Mike"
                        tel="242 702 320"
                        email="m@mansen.com"/>
            <Section/>
            <Section/>
            <Section/>
            <Section/>
            <Footer />
        </div>
    );
}

export default App;
